import axios from 'axios'


export const mainSearch = (origin, keyword) => {
  return function (dispatch) {
    console.log('Hello mainSearch', keyword)
    axios.post('/api/skyscanner/get',
    { keyword },
    { headers: { 'Content-Type': 'application/json' }
    })
    .then((response) => {
      // let aaa = getSky(origin, response.data)
      // console.log(response.data)
      // dispatch({
      //   type: 'mainSearch',
      //   payload: response.data
      // })
      // dispatch({
      //   type: 'LOADING_OFF'
      // })
      dispatch({
        type: 'GET_CHEAP',
        payload: response.data
      })
    })
    .catch(function (error) {
      console.log(error);
    });
  }
}

export const getSky = (origin, destination) => {
  console.log('SKYYYY', destination)
    console.log('fllll', destination)
    axios.post('/api/skyscanner/getCheap',
    { origin, destination },
    { headers: { 'Content-Type': 'application/json' }
    })
    .then((response) => {
      console.log(response.data)

      return response.data
    })
    .catch(function (error) {
      console.log(error);
    });
}

export const getCurrentCity = (l) => {
  return function (dispatch) {
    axios.get('/api/ip/getIP')
    .then((response) => {
      dispatch({
        type: 'GET_IP',
        payload: {
          ip: response.data.ip_address,
          city: response.data.city,
          country: response.data.country,
          lat: response.data.latitude,
          lng: response.data.longitude
        }
      })
    })
    .catch(function (error) {
      console.log(error);
    });
  }
}
